package cn.jsi.buaa;

import java.util.HashMap;

public class MinWindowSubString {
	HashMap<Character,Integer> num=new HashMap<Character,Integer>();
    HashMap<Character,Integer> rnum=new HashMap<Character,Integer>();
    char[] cs;
    char[] ts;
    int minlen=Integer.MAX_VALUE;
    String substring="";
    boolean isdebug=true;
    public String minWindow(String S, String T) {
        cs=S.toCharArray();
        ts=T.toCharArray();
        //init request Num
        int chnumber=0;
        //init rnum map
        for(Character c:ts){
            Integer count=rnum.get(c);
            if(count==null){
                count=new Integer(0);
                chnumber++;
            }
            count++;
            rnum.put(c,count);
        }
        //find the first window
        int containNum=0;
        int i=0;
        for(;i<cs.length;i++){
            char c=cs[i];
            if(!rnum.containsKey(c))
                continue;
            Integer count=num.get(c);
            Integer rcount=rnum.get(c);
            if(count==null)
                count=new Integer(0);
            count++;
            num.put(c,count);
            if(count==rnum.get(c)){
                containNum++;
                if(containNum==chnumber)
                    break;
            }
        }
        if(containNum<chnumber)
        	return "";
        i++;
        minlen=i;
        //move the window to find the minwindow.length
        int starter=0;
        while(starter<cs.length){
            char c=cs[starter];
            if(isdebug)
            System.out.println("starter="+starter+"  i="+i+"  c="+c);
            if(!num.containsKey(c)){
                int winlen=i-starter;
                if(winlen<=minlen){
                    minlen=winlen;
                    substring=S.substring(starter+1,i);
                }
                starter++;
                continue;
            }
            int i1=num.get(c);
            int i2=rnum.get(c);
            if(isdebug)
            	System.out.println("("+starter+") ["+c+"]"+i1+"/"+i2+" minlen="+minlen);
            if(i1>i2){
            	num.put(c, i1-1);
                starter++;
                int winlen=i-starter;
                if(winlen<=minlen){
                    minlen=winlen;
                    substring=S.substring(starter+1,i);
                }
                continue;
            }
            if(i1==i2){
            	num.put(c, i1-1);
            	starter++;
                //should find another c
                boolean findc=false;
                while(i<cs.length){
                    if(!num.containsKey(cs[i])){
                        i++;
                        continue;
                    }
                    char c2=cs[i];
                    Integer count=num.get(c2);
                    num.put(c2,count+1);
                    if(isdebug)
                    System.out.println("i="+i+"  put "+c2+" as "+(count+1));
                    if(cs[i]==c){
                    	i++;
                        findc=true;
                        break;
                    }
                    i++;
                }
                if(findc){
                	int winlen=i-starter;
                	if(winlen<=minlen){
                        minlen=winlen;
                        substring=S.substring(starter,i);
                    }
                }
                else
                    break;
                
            }
           
        }
        return substring;
    }
    public static void main(String[] args) {
    	MinWindowSubString mw=new MinWindowSubString();
    	String s1="";
    	char[] cc=s1.toCharArray();
    	for(char c:cc)
    		System.out.print(c+" ");
    	System.out.println();
    	for(int i=0;i<cc.length;i++)
    		System.out.print(i+" ");
    	System.out.println();
    	String s=mw.minWindow(s1, "cae");
    	System.out.println("res is  "+s);
	}

}
